  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0153493 contains raw underway
  meteorological, navigational, optical, physical and time series data logged by the
  Scientific Computer System (SCS) aboard NOAA Ship Reuben Lasker in the North Pacific
  Ocean from 2016-04-26 to 2016-05-19. Office of Marine and Aviation Operations (OMAO)
  personnel aboard the ship submitted these data and associated metadata to NCEI.
  In addition, NCEI Accession 0153493 contains supplementary cruise-level metadata,
  which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NCEI
  personnel developed the automated process to archive these data under the auspices
  of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\":
